import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        title={props.itemsexpenses[0].title}
        amount={props.itemsexpenses[0].amount}
        date={props.itemsexpenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.itemsexpenses[1].title}
        amount={props.itemsexpenses[1].amount}
        date={props.itemsexpenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.itemsexpenses[2].title}
        amount={props.itemsexpenses[2].amount}
        date={props.itemsexpenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.itemsexpenses[3].title}
        amount={props.itemsexpenses[3].amount}
        date={props.itemsexpenses[3].date}
      ></ExpenseItem>
    </div>
  );
}
export default Expenses;
